import React from 'react';
import ReactDOM from 'react-dom';

import App from './App';
import {ThemeContext, ThemeProvider} from './context/ThemeContext'


import './index.css';



ReactDOM.render(
  <React.StrictMode>
    <ThemeProvider>
      {children}
    </ThemeProvider>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
